import React from 'react';
import Carusele from './Carusele';

function HomeDeals({ text }) {
	return (
		<div
			style={{
				height: '100vh',
				background: '#99E2D9',
				scrollSnapAlign: 'center',
				display: 'flex',
				justifyContent: 'center',
				alignItems: 'center',
			}}
			className="background"
		>
			<Carusele text={text} />
		</div>
	);
}

export default HomeDeals;
